import {
    TimelineConnector,
    TimelineContent,
    TimelineDot,
    TimelineItem,
    TimelineOppositeContent,
    TimelineSeparator,
} from "@mui/lab";
import { Typography } from "@mui/material";
import React from "react";

const TimeLineCard = ({ time, activity, details, icon: Icon }) => {
    return (
        <TimelineItem>
            <TimelineContent
                sx={{ fontSize: { xs: "0.5rem", sm: "0.75em", md: "1.0em" } }}
                align="right"
                variant="body2"
                color="text.secondary"
            >
                {time}
            </TimelineContent>
            <TimelineSeparator>
                <TimelineConnector />
                    <TimelineDot>
                        <Icon />
                    </TimelineDot>
                <TimelineConnector />
            </TimelineSeparator>
            <TimelineContent>

                <Typography sx={{ fontSize: { xs: "0.75rem", sm: "0.75em", md: "1.2em" } }}>{activity}</Typography>
                <Typography color="text.secondary" sx={{ fontSize: { xs: "0.5rem", sm: "0.5em", md: "1.0em" } }} >{details}</Typography>
            </TimelineContent>
        </TimelineItem>
    );
};

export default TimeLineCard;
